import React from 'react';
import '../styles/Style.css';

function Form(props) {
  const HandleSubmit = (e) => {
    e.preventDefault();
    console.log('User submitted.');
  };

  return (
    <div className="wrapper">
      <h2>{props.symbol}</h2>

      <fieldset>
        <input name={props.name} type="text" placeholder={props.placeholder} />
      </fieldset>
    </div>
  );
}

export default Form;
